  };

  return (
    <form onSubmit={handleSubmit} className={css.form}>
      <label>
        Usuario:
        <input type="text" name="username" />
      </label>
      <label>
        Contraseña:
        <input type="password" name="password" />
      </label>
      <button type="submit">Iniciar sesión</button>
    </form>
  );
}
